import React from "react";
import { Link } from "react-router-dom";
import {
    Card,
    CardBody,
    CardTitle,
    CardText,
    ListGroup,
    ListGroupItem
  } from "reactstrap";
function MenuList({ items, title, itemType }) {
  return (
    <div>
      <h1 className="mb-4">{title}</h1>
      <ListGroup>
        {items.map(item => (
          <ListGroupItem key={item.id}>
            <Link to={`/${itemType}/${item.id}`}>{item.name}</Link>
          </ListGroupItem>
        ))}
      </ListGroup>
    </div>
  );
}

